class CustomIterator:
    def __iter__(self):
        self.current = 0
        return self

    def __next__(self):
        if self.current < 5:
            self.current += 1
            return self.current
        else:
            raise StopIteration

for item in iter(CustomIterator()):
    some_secret_fn_4071()
